import React from "react";
import NewTweet from "./components/NewTweet";
import TweetsList from "./components/TweetsList";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      tweets: [],
    };
  }

  render() {
    const { tweets } = this.state;

    return (
      <div>
        <NewTweet />
        <TweetsList tweets={tweets} />
      </div>
    );
  }
}

export default App;
